import { getItems } from '../actions/item';
import ItemCard from '../components/item/ItemCard';
import { isAuth } from '../actions/auth';

const Main = () => {


    const showListedItems = () => {
        const token = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI1ZjU4ZGYwZjU0ZDgyZTMyMWM5ZjdhMjAiLCJpYXQiOjE1OTk2NjQ4ODIsImV4cCI6MTU5OTc1MTI4Mn0.H0WuYMGCy8cL_ivXGJzZ_D0dAX-JYS4xHK44K_mEC_c';
        getItems(token).then( items => {
            return items.map((item, i) => {
                return (
                    <article key={i}>
                        <ItemCard item={item}/>
                    </article>
                );
            })}
        ); 
    };

    const logItems = () => {
        const token = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI1ZjU4ZGYwZjU0ZDgyZTMyMWM5ZjdhMjAiLCJpYXQiOjE1OTk2NjQ4ODIsImV4cCI6MTU5OTc1MTI4Mn0.H0WuYMGCy8cL_ivXGJzZ_D0dAX-JYS4xHK44K_mEC_c';
        getItems(token).then(items => console.log(items));
    };

    return (
        <div className='main'>
            <div className='main__title'>
                <h2>Shopping List</h2>
            </div>
            <div className='main__body'>
                {showListedItems()}
                {/*logItems()*/}
            </div>
        </div>
    );
};

export default Main;
